import React from "react";
import {IProfile} from "../models/IProfile";
interface IProps {
    profile : IProfile
}
interface IState {

}

let GithubProfileCard:React.FC<IProps> =({profile}) =>{
    return(
        <React.Fragment>
            <div className="card">
                <img src={profile.avatar_url} alt="" className="img-fluid"/>
                <div className="card-body">
                    <p className="h4">{profile.name}</p>
                    <small>{profile.bio}</small><br/>
                    <a href={profile.html_url} target="_blank" className="btn btn-success btn-sm">Profile</a>
                </div>
            </div>
        </React.Fragment>
    )
};
export default GithubProfileCard;
